INSERT INTO `faculties_info` (`id`, `name`, `category`, `description`, `dean_name`, `dean_image`, `image`) VALUES
(1, 'Факультет Информатики и вычислительной техники ДГТУ', 'Информатика и вычислительная техника', 'Предоставляет уникальные образовательные программы, сочетающие теоретические знания с практическим опытом, для подготовки специалистов в области информационных технологий и программирования.', 'Поркшеян Виталий Маркосович', 'images/fCNV-9HwAUR8SmDz2Do_fqQtrGfIcmqUgI9JnWuZ3Vy3MaqneEzGKfaRgbckpAnIBMKdWV5M.jpg', 'images/4.jpg'),
(2, 'Факультет Юридический ДГТУ', 'Юридический', 'Предоставляет высококачественное образование в области права, развивая навыки анализа законодательства, практического применения правовых норм и формирования профессиональной этики.', 'Исакова Юлия Игоревна', 'images/i.jpg', 'images/1by0LuZrbi8.jpg'),
(3, 'Факультет Технологии Машиностроения ДГТУ', 'Технология Машиностроения', 'Предоставляет студентам глубокие знания в области проектирования, производства и эксплуатации машин и оборудования, обеспечивая комплексное понимание современных технологий и инженерных методов.', 'Чаава Михаил Мегонович', 'images/5.JPG', 'images/4-25.jpg'),
(4, 'Факультет Биоинженерия и ветеринарная медицина ДГТУ', 'Биоинженерия и ветеринарная медицина', 'выпускает высококвалифицированных специалистов, способных работать в ключевых и смежных отраслях био- и наноинженерных наук, фармации и ветеринарии.', 'Ермаков Алексей Михайлович', 'images\\ЕрмаковАМ.jpg', 'images\\8i7h01r3lo359cuq0qjyq2usw3fgcpg1.png'),
(5, 'Факультет Авиастроения ДГТУ', 'Авиастроение', 'готовит специалистов для авиационной отрасли: разработка технологий воздушных судов, обслуживание и ремонт авиатехники, системы вентиляции и кондиционирования, включая их применение в транспорте.  занимается разработкой документации для новых машин на аэродромах.\r\n\r\n\r\n\r\n', 'Зимовнов Олег Владимирович', 'images/Захват.JPG', 'images/2hdv2oa3bozm3f25q5ote5qh8461jmth.jpeg'),
(6, 'Факультет Автоматизация, мехатроника и управление ДГТУ', 'Автоматизация, мехатроника и управление', 'Факультет ведет подготовку студентов по ряду направлений машиностроительного профиля для предприятий промышленного комплекса, использующих автоматизированные, мехатронные, робототехнические, гидравлические, и электромеханические системы.', 'Наумов Иван Иванович', 'images/jfkL5VIOBeE.jpg\"', 'images/neyt6zsbmy0bagvqaeyvj7ef3nrf28tm.jpg'),
(7, 'Факультет Агропромышленный ДГТУ', 'Агропромышленный', 'факультет «Агропромышленный» ДГТУ готовит передовых и успешных агроспециалистов области.Современные методы обучения, высокие стандарты преподавания, материально-техническое оснащение учебного процесса обучающихся.', 'Рудой Дмитрий Владимирович', 'images/4076.jpeg', 'images/s3rjc3o2e1uakdyn568q4tomob3e3a1e.jpg'),
(8, 'Факультет Безопасность жизнедеятельности и инженерная экология ДГТУ', 'Безопасность жизнедеятельности и инженерная экология', 'Факультет предлагает учащимся широкий спектр специальностей, востребованных производством, бизнесом, органами административного управления. Так, области профессиональной деятельности инженера по «Пожарной безопасности» включают: анализ, организацию, экспертизу и обеспечение пожаро-взрывобезопасности промышленных предприятий. ', 'Семенихин Александр Валентинович\r\n', 'images/3LHOlgkZLx8.jpg', 'images/wf9k75a4jxtxwe4qdh52eapn7ytpei80.jpg'),
(9, 'Факультет Дорожно-транспортный ДГТУ', 'Дорожно-транспортный ', 'ведет подготовку высококвалифицированных специалистов в области: проектирования, строительства и эксплуатации автомобильных дорог, мостов, тоннелей и других сооружений на дорогах;', 'ТОПИЛИН ИВАН ВЛАДИМИРОВИЧ', 'images/Захват2.JPG', 'images/zdfg7cvwco5yxsm5nyy91oqqehpwapq0.jpg'),
(10, ' Факультет Инженерно-строительный ДГТУ', 'Инженерно-строительный', 'Факультет готовит бакалавров, магистров и специалистов по шести направлениям, одиннадцати профилям. Практическая подготовка студентов ведется на семи базовых кафедрах, созданных совместно с производственными предприятиями Ростовской области.', 'Явруян Хунгианос Степанович', 'images/ЯвруянХС.jpg', 'images/q379otai1wcqrxt3slas7fyrgpcd1lev.png'),
(11, 'Факультет Инновационный бизнес и менеджмент ДГТУ', 'Инновационный бизнес и менеджмент', 'Студенты факультета «ИБиМ» ведут активную научную работу, принимают участие и завоевывают призовые места в городских, региональных, российских и международных конференциях. За отличные показатели в учебе и достигнутые успехи в научных исследованиях студентам назначаются стипендии Правительства и Президента Российской Федерации, а также губернаторские. ', 'Осадчая Наталья Алексеевна', 'images/WhatsApp Image 2023-02-13 at 09.09.32.jpeg', 'images/cs4slhiba1rtrszq90i9kelmn12o92cu.jpg'),
(12, 'Факультет Институт военного образования ДГТУ', 'Институт военного образования', 'Основной целью деятельности ИВО является содействие укреплению обороноспособности страны, национальной безопасности и формирование патриотической личности у обучающихся.', 'ЦАЛЬ АНДРЕЙ ЮРЬЕВИЧ', 'images/Захват3.JPG', 'images/6l1djs20dv1wozp85chbybbkiiwbpaq8.png'),
(13, 'Институт опережающих технологий «Школа Икс»', 'Институт опережающих технологий «Школа Икс»', 'Обучение в институте базируется на проектной деятельности в составе команд, а успех опирается на умение самоорганизовываться и анализировать траекторию личностного развития. Студенты помимо основной образовательной программы самостоятельно выбирают дополнительные направления обучения. ', 'Герасин Павел Владимирович', 'images/Павел Герасин.jpg', 'images/3080ii03mdnzurr7swpxzxqtxbwlw0kx.jpg'),
(14, 'Институт перспективного машиностроения «Ростсельмаш»‎', 'Институт перспективного машиностроения «Ростсельмаш»‎', 'Цель передовой инженерной школы ДГТУ, создаваемой в партнерстве с компанией «Ростсельмаш», — подготовка инженерных команд, способных создавать интеллектуальную кастомизированную технику для обеспечения продовольственной безопасности и конкурентоспособности продукции АПК России на мировом уровне.', 'Пигенко Владислав Анатольевич', 'images/m367348a9u87vs0okkjrl1t7hges784o.jfif', 'images/q3vf3kwli1gli3gupkpuj3axnnbukug7.jpg'),
(15, 'Институт физической культуры и спорта', 'Институт физической культуры и спорта', 'Основным направлением деятельности Института физической культуры и спорта ДГТУ является обеспечение подготовки специалистов в области физической культуры и спорта на основе интеграции образовательной и научной деятельности', 'Мавропуло Ольга Савельевна', 'images/МавропулоОС.jpg', 'images/w18n3n2y0lapxqh12om81qu0ayhoanwj.jfif'),
(16, 'Факультет Кораблестроения и морской техники ДГТУ', 'Кораблестроение и морская техника', 'Факультет «Кораблестроение и морская техника» занимается подготовкой квалифицированных инженерных и научных кадров для судостроительной и судоремонтной промышленности Юга России.', 'Пахомов Илья Викторович', 'images/wnnsqah8epuobis3bwxbsnwl33zwdk2q.png', 'images/fryxktq5hcchkrou47ddpmxd1lo2l5pb.jpg'),
(17, 'Факультет Медиакоммуникаций и мультимедийных технологий ДГТУ', 'Медиакоммуникации и мультимедийные технологии', 'МКиМТ развивает новые рынки креативной экономики, объединяет ученых, исследователей, предпринимателей, продюсеров, разработчиков контента для создания сложных и востребованных продуктов, а также формирует среду для обучения, творчества и развития собственных стартапов.', 'Дубовер Денис Анатольевич', 'images/Захват4.jpg', 'images/1rvt4d62a9mtp11eq2jzyjen5z4ii003.jpg'),
(18, 'Факультет Международный ДГТУ', 'Международный', 'ДГТУ – один из ведущих и старейших центров Российской Федерации по подготовке специалистов для зарубежных стран.\r\nФакультет «Международный» основанный в 1975 году, готовит иностранцев к поступлению в высшие учебные заведения России.Обучение русскому языку и подготовка иностранных граждан к поступлению в вузы РФ началась в ДГТУ с момента образования факультета для иностранных граждан 30 мая в 1975 году.', 'Новикова Нина Валентиновна', 'images/Новикова Нина Валентиновна.jpg', 'images/hbc9yax94wbkco43be7bqz2ttwchu375.jpg'),
(19, 'Факультет Прикладной лингвистики ДГТУ', 'Прикладная лингвистика', 'Образовательные программы, реализуемые факультетом «Прикладная лингвистика», опираются на лучшие мировые образовательные практики и соответствуют последним образовательным стандартам. Результат – высококвалифицированные специалисты, способные работать в команде и продуктивно действовать в ситуациях неопределенности, находя решения актуальных проблем и задач современности.', 'Муругова Елена Валерьевна', 'images/1720.jpeg', 'images/qv2vxbkyvs9iwjgl6n79jm6l05iehwpo.png'),
(20, 'Факультет Промышленного и гражданского строительства ДГТУ', 'Промышленное и гражданское строительство', 'Высокий научный потенциал института и кафедр, развитая материальная база, глубокие связи с производством, активное участие в международных программах служат хорошей основой для подготовки высококвалифицированных выпускников, которые сегодня успешно работают практически во всех регионах Российской Федерации, в странах ближнего и дальнего зарубежья и достойно представляют Донской государственный технический университет.', 'Евтушенко Александр Иванович\r\n', 'images/ЕвтушенкоАИ.jpg', 'images/dc9cl9blxgicc266u7thgfulxag2d1ns.jpg'),
(21, 'Факультет Психологии, педагогики и дефектологии ДГТУ', 'Психология, педагогика и дефектология', 'Обучение ведется по 12 направлениям, среди которых начальное образование, организация и управление дошкольным образованием, социальная педагогика педагогогическая психология и логопедия, информатика и вычислительная техника (прикладная информатика), а также патопсихологическая диагностика, клинико-социальная реабилитация и психология служебной деятельности', 'Абакумова Ирина Владимировна', 'images/АбакумоваИВ.jpg', 'images/5t8vj7a1a2ytypyctjov5wa80d5bun5n.png'),
(22, 'Факультет Сервиса и туризма ДГТУ', 'Сервис и туризм\r\n', 'Материально-техническое оснащение на факультете позволяет вести обучение в соответствии с требованиями ФГОС ВО по всем направлениям. Лекционные и лабораторные аудитории оснащены современным мультимедийным оборудованием. Компьютерные классы позволяют активно использовать в обучении передовые информационные технологии. В учебном процессе используются выездные семинары на базе объектов социально-культурного сервиса, объектов гостеприимства, общественного питания и т. д.', 'Минасян Лариса Артаваздовна', 'images/Захват5.jpg', 'images/wp6vfq1nducb1sxh9q9hg4teim8arqai.jpg'),
(23, 'Факультет Социально-гуманитарный ДГТУ', 'Социально-гуманитарный', 'Особенностью обучения на нашем факультете является не только получение новых знаний, но и новое знакомство с собой, собственное развитие. В состав факультета входит 4 кафедры, 3 из которых являются выпускающими.\r\n\r\n', 'Былкова Светлана Викторовна', 'images/БылковаСВ.jpg', 'images/4kjnejiwcel19msiuieva6rp8hd6j2m2.jpg'),
(24, 'Институт сквозных технологий\r\n«Т—университет»', 'Институт сквозных технологий\r\n«Т—университет»', 'Т—университет дает новые возможности для получения актуальных навыков и компетенций, реализации собственного потенциала в практико-ориентированной деятельности, а также для успешного трудоустройства в ведущие российские и мировые компании.', 'Маркарьян Юлия Артемовна\r\n', 'images/f8cwiyiu345phgg0fpbte2eusfgzqqz3.png', 'images/9b55626bxc7l0zof8933fl1rqogruecv.jpg'),
(25, 'Факультет Транспорта, сервиса и эксплуатации ДГТУ', 'Транспорт, сервис и эксплуатация\r\n', 'Студенты факультета проходят практику на ведущих предприятиях Ростовской области, совмещают обучения с работой в малых инновационных предприятиях ДГТУ, корпоративном инженерно-консультационном центре «Мысль».', 'Букланов Дмитрий Александрович\r\n', 'images/dvrxpqmgtbhzl3g0d0t78n35zg7vxakt.jpg', 'images/22lhmt3ki2lizsjgcv5ze5dxv5lftsdy.jpg'),
(26, 'Школа архитектуры, дизайна и искусств', 'Школа архитектуры, дизайна и искусств', 'Факультет «Школа архитектуры, дизайна и искусств» готовит бакалавров и магистров по таким направлениям, как «Архитектура», «Реконструкция и реставрация архитектурного наследия», «Градостроительство», «Дизайн архитектурной среды», «Строительство» (профиль «Проектирование зданий»), а также занимается подготовкой аспирантов.', 'Вяликов Иван Леонидович\r\n', 'images/ВяликовИЛ.jpg', 'images/fj74spmqw4d5ns7im021a1sszbhe1ksr.jpg'),
(27, 'Факультет Энергетики и нефтегазопромышленности ДГТУ', 'Энергетика и нефтегазопромышленность', 'Выпускники факультета занимаются проектированием интеллектуальных современных автоматизированных систем, эксплуатацией, монтажом, и ремонтом энергетического и нефтегазового оборудования, организуют выполнение работ по анализу исходного сырья и готовой продукции химических, электрохимических и нефтегазовых предприятий, обеспечивают безопасность и минимизацию техногенного воздействия на окружающую среду, способствующие сохранению жизни и здоровья человека.', 'Фугаров Дмитрий Дмитриевич\r\n', 'images/2iqxhzpz9s8zz6esg2c7xemagau3gixo.jpg', 'images/59g3ayb17o4la6tkagokrubs80mqtw7l.jpg');
INSERT INTO `faculty_details` (`id`, `faculty_name`, `faculty_logo`, `faculty_number_1`, `faculty_number_2`, `faculty_number_3`, `faculty_address`, `faculty_vk_link`, `faculty_email`, `faculty_working_hours`, `faculty_info`) VALUES
(1, 'Информатика и вычислительная техника', ' images/faculty/l20lxsu79yn053bf888s9l9cnvghdolg.jpg', '273-86-28', '273-86-26 ', '273-86-27', 'пл. Гагарина, 1, корпус 1, ауд. 1- 346, 1-347а, 1-309', 'https://vk.com/iivtdstu', 'spu-46@donstu.ru', 'в будние дни с 8:30 до 17:30\r\nсуббота с с 8:30 до 14:00', 'Факультет «Информатика и Вычислительная техника», созданный в 2008 году, является передовым образовательным и научным центром, специализирующимся на подготовке специалистов в сфере информационных технологий и занимает лидирующие позиции в подготовке квалифицированных IT-специалистов. Носит статус локального оргкомитета Межрегиональной олимпиады школьников по математике и криптографии\r\n\r\nФакультет ИиВТ объединяет 14 научных школ и 8 кафедр, штат научно-педагогического состава – более 170 сотрудников, включая 12 докторов и 51 кандидата наук.\r\n\r\nКонтингент студентов факультета составляет около 2400 человек, большинство из которых обучаются в дневной форме. Образовательный процесс структурирован таким образом, чтобы студенты могли получить глубокие знания в двух специалитетах, семи направлениях бакалавриата и шести направлениях магистратуры, а также продолжить научную деятельность в аспирантуре и докторантуре.\r\n\r\nСтуденты ИиВТ получают фундаментальные знания в области математике и информатике, а также разноплановые прикладные навыки и практические компетенции в сфере IT.\r\n\r\nСпециалисты, подготовленные на факультете, обладают необходимыми компетенциями для работы в таких важнейших областях, как разработка и защита информационных систем, анализ и обработка данных.\r\n\r\nВыпускники факультета ИиВТ ценятся на рынке труда за свои знания и навыки, которые позволяют им вносить значительный вклад в развитие информационной безопасности и технологический прогресс в регионе и за его пределами. Они особо востребованы в банковском секторе как Ростовской области, так и федерального уровня, становятся высококлассными специалистами сферы безопасности, включая государственную службу.\r\n\r\nФакультет активно сотрудничает с ведущими предприятиями и научно-исследовательскими институтами, такими как Министерство информационных технологий и связи Ростовской области, АО ВНИИ «Градиент», и другими значимыми организациями. Эти партнерства не только способствуют практическому применению знаний студентами, но и обеспечивают успешное трудоустройство выпускников.'),
(2, 'Юридический', 'images/faculty/099lFxS2SIk.jpg', '201-91-54', '', NULL, 'ул. Социалистическая, 162, корпус 25, каб. 25-405', 'https://vk.com/dstu.juridicus', 'spu-59@donstu.ru', 'в будние дни с 8:30 до 16:00\r\nв субботу с 8:30 до 14:00', 'В настоящее время на факультете работают 9 докторов наук, 47 кандидатов наук. 90% научно-педагогических работников имеют ученые степени и звания. На факультете ведется активная научно-исследовательская работа, функционируют 3 студенческих научных кружка – «Государствовед», «Юрист-криминалист», «Цивилист».\r\n\r\nЕжегодно проводятся научные мероприятия: студенческая научно-практическая конференция «Межотраслевые проблемы формирования правовой культуры в молодежной среде», Национальная научно-практическая конференция «Правовой порядок и правовые ценности». На базе Южного окружного военного суда проводится Национальная научно-практическая конференция «Противодействие идеологии экстремистской и террористической деятельности среди молодежи».\r\n\r\nНа факультете открыт научно-практический рецензируемый журнал «Правовой порядок и правовые ценности», в котором публикуются статьи ведущих специалистов, освещающих актуальные вопросы в области юриспруденции.\r\n\r\nФакультет придает огромное значение качеству предоставления образовательных услуг. В этой связи регулярно проводится мониторинг уровня удовлетворенности потребителей, анализируются их запросы и предпринимаются соответствующие действия для улучшения образовательного процесса. Благодаря этому уровень успеваемости на факультете неуклонно растет.\r\n\r\nАктивно развивается система студенческого самоуправления, профсоюзное движение. Отличительной особенностью факультета «Юридический» является наличие высокой корпоративной культуры, основанной на духовных ценностях и принципах, разделяемых всеми членами факультетского сообщества'),
(3, 'Технология машиностроения', 'images/faculty/5cbejyodeqctczbhgr0eyzft2k06kw7f.jpg', '273-85-58 ', '273-85-21', ' 273-87-40', 'пл. Гагарина, 1, корпус 1, ауд. 1-274, 1-275, 1-276', 'https://vk.com/activ_tm?w=club59109699', 'spu-55@donstu.ru', 'в будние дни с 8:30 до 17:00\r\nсуббота с 8:30 до 14:00', 'Факультет «Технология машиностроения» ДГТУ успешно готовит современных инженеров: технологов, конструкторов, специалистов в области машиностроения, сельхозмашиностроения, авиастроения, черной и цветной металлургии, художественной обработки материалов, автоматизации сварочных процессов, а также специалистов в области графического дизайна и конструирования изделий легкой промышленности.\r\n\r\nЕсли ты хочешь в будущем иметь востребованную, престижную и высокооплачиваемую профессию, хочешь разбираться в особенностях работы конструктора, технолога, разрабатывать программы для современных металлообрабатывающих комплексов с ЧПУ, быть графическим дизайнером и разрабатывать интересные решения в полиграфии и рекламе, конструировать и создавать одежду, воплощать свои идеи в собственные проекты и решать поставленные научно-технические задачи от ведущих предприятий, то у тебя есть возможность провести свои студенческие годы, наполненные невероятными событиями, яркими эмоциями и открытиями в кругу друзей и единомышленников – тогда факультет «Технология машиностроения» ждет именно тебя!\r\n\r\n'),
(4, 'Биоинженерия и ветеринарная медицина', 'images/faculty/ig3sj7v3seo1ht8x91ydeh7eou6sfwsk.jpg', '238-13-09', '23-81-31', NULL, 'пл. Гагарина, 1, корпус 6, ауд. 6-303', 'https://vk.com/biovetmed.dstu', 'spu-45@donstu.ru', 'в будние дни с 8:30 до 17:00', 'Стремительное развитие естественных наук привело к использованию новых практических подходов для решения прикладных проблем государства и разработки иных технологий в различных отраслях. Факультет «Биоинженерия и ветеринарная медицина» выпускает высококвалифицированных специалистов, способных работать в ключевых и смежных отраслях био- и наноинженерных наук, фармации и ветеринарии. Это первый в России факультет, который начал готовить специалистов по болезням домашних питомцев для городской ветеринарии.\r\n'),
(5, 'Авиастроение', 'images/faculty/maex-zlwQ2I.jpg', '258-91-23 ', '258-91-14 ', '258-91-19', 'ул. Страны Советов, 1', 'https://vk.com/dekanatavia', 'spu-36@donstu.ru', 'в будние дни с 8:30 до 16:00\r\nв субботу с 8:30 до 14:00', 'Факультет «Авиастроение» создан в 2013 году с целью обеспечения реального сектора экономики кадрами в области разработки технологических процессов производства воздушных судов, ремонта и обслуживания авиационной техники, обеспечения работоспособности холодильных и криогенных систем, систем кондиционирования и вентиляции, в том числе на транспорте, а также разработки конструкторско-технологической документации новых и модернизируемых наземных транспортно-технологических машин для аэродромов.\r\n\r\n'),
(6, 'Автоматизация, мехатроника и управление', 'images/faculty/6l92vtqxgt0bjoewuuw4mst96v20rs6v.jpg', '273- 86-38 ', '273-86-39', ' 273-86-40', 'пл. Гагарина, 1, корпус 1, ауд. 1-279, 1-280, 1-281', 'https://vk.com/donstu_amiu', 'spu-37@donstu.ru', 'в будние дни с 8:30 до 17:00\r\nсуббота с 8:30 до 12:00', 'Факультет ведет подготовку студентов по ряду направлений машиностроительного профиля для предприятий промышленного комплекса, использующих автоматизированные, мехатронные, робототехнические, гидравлические, и электромеханические системы. Осуществляется подготовка преподавателей физики и математики для средней школы и средне профессиональны учреждений. Выбрав любое из наших направлений, вы получите фундаментальную подготовку по: математике и физике, информатике и электронике, компьютерной и микропроцессорной технике.\r\n\r\n');
