('Человек-знаковая система', 'Мечтаете ли вы о работе в команде математиков, программистов и инженеров, решающих сложные задачи?', '01.03.04 Прикладная математика'),
('Человек-знаковая система', 'Интересно ли вам изучение математических инструментов, направленных на решение реальных проблем?', '01.03.04 Прикладная математика'),
('Человек-знаковая система', 'Хотели бы вы научиться применять математические знания для разработки новых технологий и оптимизации процессов в различных областях науки и промышленности?', '01.03.04 Прикладная математика'),
('Человек-знаковая система', 'Интересуетесь ли вы математикой и её ролью в информационных технологиях?', '02.03.03 Математическое обеспечение и администрирование информационных систем'),
('Человек-знаковая система', 'Чувствуете ли вы важность математического анализа данных для обеспечения работы информационных систем?', '02.03.03 Математическое обеспечение и администрирование информационных систем'),
('Человек-знаковая система', 'Мечтаете ли вы о карьере, связанной с разработкой и обслуживанием информационных систем?', '02.03.03 Математическое обеспечение и администрирование информационных систем'),
('Человек-знаковая система', 'Важно ли для вас понимание математических методов анализа и оптимизации информационных процессов?', '02.03.03 Математическое обеспечение и администрирование информационных систем'),
('Человек-знаковая система', 'Готовы ли вы изучать различные алгоритмы и моделирование для создания и поддержки информационных систем?', '02.03.03 Математическое обеспечение и администрирование информационных систем'),
('Человек-знаковая система', 'Мечтаете ли вы о работе в команде администраторов и инженеров, занимающихся обслуживанием и развитием информационных технологий?', '02.03.03 Математическое обеспечение и администрирование информационных систем'),
('Человек-знаковая система', 'Интересно ли вам изучение математических аспектов криптографии и защиты информации?', '02.03.03 Математическое обеспечение и администрирование информационных систем'),
('Человек-знаковая система', 'Хотели бы вы научиться применять математические методы для разработки и обеспечения безопасности информационных систем в различных сферах, таких как банковское дело, медицина или государственное управление?', '02.03.03 Математическое обеспечение и администрирование информационных систем'),
('Человек-знаковая система', 'Интересуетесь ли вы применением математики и физики для решения практических задач?', '03.03.01 Прикладные математика и физика'),
('Человек-знаковая система', 'Чувствуете ли вы важность сочетания математических и физических знаний в науке и промышленности?', '03.03.01 Прикладные математика и физика'),
('Человек-знаковая система', 'Мечтаете ли вы о карьере, связанной с исследованиями в области прикладной математики и физики?', '03.03.01 Прикладные математика и физика'),
